import { Form } from "antd";
import { dummy } from "../../utils/dummy";

const Settings = () => {
  return (
    <div className="settings">
      <Form>
        <input type="text" class="form-input" value={dummy.name} />
      </Form>
    </div>
  );
};

export default Settings;
